def e2g(edges):
    graph = {}
    bgraph = {}
    for src, dst in edges:
        if src not in graph:
            graph[src] = set()
        if dst not in graph:
            graph[dst] = set()
        graph[src].add(dst)
    return graph




def solver(colors, edges):
    if len(edges) == 0:
        return 1
    graph = e2g(edges)
    ref = ord('a')
    # def dfs function
    # next = dfs(next.node)
    # if current already in nextvisited, indicate loop, return inf
    # cache the result (hashmap of max count for each colour,visited)
    memo = {}
    max_appear = 0
    def dfs(node, visited):
        nonlocal max_appear
        if node in graph[node]: 
            memo[node] = inf
            max_appear = inf
            return inf 
        if node in visited: 
            memo[node] = inf
            max_appear = inf
            return inf 
        if node in memo: 
            return memo[node]
        visited.add(node)
        res = [0 for i in range(26)]
        c = ord(colors[node]) - ref 
        if len(graph[node]) == 0: 
            # this means last 
            res[c] += 1 
            max_appear = max(max_appear, 1)
            memo[node] = res
            visited.remove(node)
            return res 
        for nei in graph[node]: 
            next_node = dfs(nei, visited)
            if next_node == inf: 
                memo[node] = inf
                return inf 
            for i in range(26): 
                res[i] = max(res[i], next_node[i])
        res[c] += 1 
        max_appear = max(max_appear, res[c])
        visited.remove(node) 
        memo[node] = res 
        return res 

    for node in graph:
        if node not in memo:
            dfs(node, set())
        if max_appear == inf:
            return -1
    return max_appear






